import majorlogo from './img/majorlogo.png';

function MainPage(){

    return(
        <div className="rightPanel">
        <div className="majorCard">
          <div className = "presidentCard">
            <h2>컴퓨터공학부</h2>
            <p>온라인 장부 입니다.</p>
            <img src={majorlogo} className="image" alt="" />
          </div>
        </div>
      </div>
    )
}

export default MainPage;
